import Root from "./route/Root";
import { CreateUrl, UrlList, WorldsContainer, Signin, Signup } from "./route";
import { ROUTES } from "./constants";

const routes = [
  {
    component: Root,
    routes: [
      {
        path: ROUTES.HOME,
        exact: true,
        component: CreateUrl,
      },{
        path: ROUTES.LIST,
        exact: true,
        component: UrlList,
      },{
        path: ROUTES.WORDS,
        exact: true,
        component: WorldsContainer,
      },{
        path: ROUTES.SIGNIN,
        exact: true,
        component: Signin,
      },{
        path: ROUTES.SIGNUP,
        exact: true,
        component: Signup,
      }
    ]
  }
];

export default routes;
